// ==UserScript==
// @name         键盘打字音效
// @version      0.2
// @description  网页上打字时，发出键盘敲击的声音(蚩尤后裔)
// @author       蚩尤后裔
// @match        https://*/*
// @match        http://*/*
// @grant        GM_registerMenuCommand
// @grant        GM_getValue
// @grant        GM_setValue
// @grant        GM_deleteValue
// @require      http://libs.baidu.com/jquery/2.0.0/jquery.min.js
// @require      https://cdn.bootcdn.net/ajax/libs/artDialog/7.0.0/dialog.js
// @license      MIT
// @namespace https://greasyfork.org/users/1008816
// @downloadURL https://update.greasyfork.org/scripts/460739/%E9%94%AE%E7%9B%98%E6%89%93%E5%AD%97%E9%9F%B3%E6%95%88.user.js
// @updateURL https://update.greasyfork.org/scripts/460739/%E9%94%AE%E7%9B%98%E6%89%93%E5%AD%97%E9%9F%B3%E6%95%88.meta.js
// ==/UserScript==

(function() {
    'use strict';

    //声音对象
    var audio = new Audio();
    // 音效内容(http或者https网络地址容易因为跨域而无法访问)
    const audioSrcArr = [
        'data:audio/mpeg;base64,',
        'data:audio/mpeg;base64,',
        'data:audio/mpeg;base64,',
        'data:audio/mpeg;base64,',
        'data:audio/mpeg;base64,',
        'data:audio/mpeg;base64,'
    ];
    // 缓存记录用户选择的音效
    const cacheKey_select_audio_src = "cacheKey_select_audio_src";
    // 当前选择的音效
    let selectAudioSrc;

    // 初始化
    function init(){
        // 缓存有值时进行回写
        if(GM_getValue(cacheKey_select_audio_src)) {
            selectAudioSrc = audioSrcArr[GM_getValue(cacheKey_select_audio_src)];
        } else {
            // 默认选择第一个
            selectAudioSrc = audioSrcArr[0];
        }
        // 设置播放速度,稍微快一点才能跟上手敲击的节奏
        audio.defaultPlaybackRate = 2;
        audio.src = selectAudioSrc;//设置播放内容
        audio.volume = 1;// 音量
        // 监听键盘事件
        document.addEventListener("keydown", function(event) {
            //currentTime：当前音频/视频的播放位置（以秒计）
            var currentTime = 0;
            audio.play();// 播放
        });

        // 为展示的音效绑定事件
        $("#kw").on("change", function(){
            var currentTime = 0;
            audio.play();// 播放
        });

    }

    /**
    * 自定义设置菜单功能
    */
    function customSetting() {
        // 如果已经弹出了，则直接跳过，不再重复弹出
        if($("#wmx_dialog_div").length > 0 ){
            return;
        }
        let contentHtml = "<div id='wmx_dialog_div' style='font-size: 20px'>";
        for(let i=0;i < audioSrcArr.length; i++){
            contentHtml += "<input type='radio' name='selectAudioSrc' value='" + i + "'>音效" + ( i + 1 ) + "&nbsp;&nbsp;";
            if((i+1) % 3 == 0){
                contentHtml += "<br>";
            }
        }
        contentHtml += "</div>";
        let wmx_dialog = dialog({
            title: '设置音效',
            quickClose: true, // 点击空白处快速关闭
            fixed: true,
            content: contentHtml
        });
        // 缓存有值时，进行回写
        if(GM_getValue(cacheKey_select_audio_src)) {
            $("input[value='" + GM_getValue(cacheKey_select_audio_src) + "']").prop("checked", true);
        }
        wmx_dialog.showModal();// 弹框

        // 为展示的音效绑定事件
        $("input[name='selectAudioSrc']").on("change", function(){
            audio.src = audioSrcArr[$(this).val()];
            audio.play();// 播放
            GM_setValue(cacheKey_select_audio_src, $(this).val());//存储用户选择的音效
        });
    }

    init();// 初始化
    GM_registerMenuCommand("自定义设置", customSetting);// 自定义功能菜单

})();